import React from 'react'
import { withOktaAuth } from "@okta/okta-react";


export default withOktaAuth(class CreateUserForm extends React.Component {

    state = {
        firstName: '',
        lastName: '',
        email: '',
        login: '',
        mobilePhone: '',
        groups: [],
    }

    onChangeHandler = (e) => {
        if (e.target.name === "firstName") {
            this.setState({
                firstName: e.target.value
            })
        }
    }

    onSubmitHandler = (e) => {
        e.preventDefault()
        console.log(this.state)
    }

    render() {
        return(
            <div>
                <h6>Create User</h6>
                <form onSubmit={this.onSubmitHandler}>
                    <input type="text" name="firstName" onChange={this.onChangeHandler} placeholder="First Name" />
                    <input type="submit" />

                </form>
            </div>


        )
    }
})
